  regarding the total approved actual expenses incurred by Montgomery County government
  employees traveling non-locally (over 75 miles from the Countyu2019s Executive Office
  Building at 101 Monroe St. Rockville, MD) for official business, beginning on or
  after August 12, 2015. The dataset includes the name of traveling employee; the
  employeeu2019s home department; travel start and end dates; destination; purpose
  of travel; and actual total expenses funded by the County.  Update Frequency: Monthly\",\n\t\"license_title\":
